import React from 'react';
import { useNavigate } from 'react-router-dom';
import useProfileStore from '../../store/profileStore';
import useCreateTeams from '../../hooks/useCreateTeams';
import './ProfilePage.css'; // Reuse RoomPage.css with minor adjustments

const ProfilePage = () => {
  const navigate = useNavigate();
  const { extractedProfiles, isCreatingTeams } = useProfileStore();
  const { createTeams } = useCreateTeams();

  return (
    <div className="room-page"> {/* Using same class as RoomPage */}
      <div className="room-header">
        <div className="header-content">
          <div className="room-info">
            <h1>Research Profiles</h1>
            <p className="creator-info">
              {extractedProfiles.length} {extractedProfiles.length === 1 ? 'profile' : 'profiles'} extracted
            </p>
          </div>
          <div className="header-actions">
            <button 
              onClick={() => navigate('/')} 
              className="secondary-button"
            >
              ← Back to Home
            </button>
          </div>
        </div>
      </div>

      <div className="content-container">
        {extractedProfiles.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">
              <span role="img" aria-label="Research">🔬</span>
            </div>
            <h3>No Profiles Available</h3>
            <p>Extract research profiles from the homepage to get started</p>
            <button 
              onClick={() => navigate('/')} 
              className="primary-button"
            >
              Go to Homepage
            </button>
          </div>
        ) : (
          <>
            <div className="profile-grid"> {/* Same grid layout as RoomPage */}
              {extractedProfiles.map((profile, idx) => (
                <div className="profile-card" key={idx}>
                  <div className="card-header">
                    <h3>{profile.name}</h3>
                    {profile.affiliation && (
                      <span className="email-badge">{profile.affiliation}</span>
                    )}
                  </div>
                  <div className="card-body">
                    <h4 className="section-title">Research Topics:</h4>
                    {profile.research_topics?.length > 0 ? (
                      <div className="topics-container">
                        {profile.research_topics.map((topic, i) => (
                          <span key={i} className="topic-tag">{topic}</span>
                        ))}
                      </div>
                    ) : (
                      <p className="no-topics">No topics extracted</p>
                    )}
                  </div>
                </div>
              ))}
            </div>

            <div className="generate-teams-container">
              <button
                className="generate-teams-btn"
                onClick={createTeams}
                disabled={isCreatingTeams || extractedProfiles.length === 0}
              >
                {isCreatingTeams ? (
                  <>
                    <span className="loading-spinner"></span> Creating Teams...
                  </>
                ) : (
                  'Generate Research Teams'
                )}
              </button>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default ProfilePage;
